sys_variable_value.value:
(function paginate(variables, pageResponse) {
    /* Summary: This script determines whether to retrieve another page
        of glacier records from the web service. */
    
    // Calculate how many records to retrieve
    // then determine the ordinal number of the last glacier to get
    var totalRecs = Number(variables.glaciers_per_page) * Number(variables.num_pages);
    var lastRec = Number(variables.start_with) + totalRecs;

    // If the value of 'variables.glacier_number' is less than the ordinal of the last record to get,
    // get another page. If not, set 'variables.getNextPage' to false.
    variables.getNextPage = Number(variables.glacier_number) < lastRec ? true : false;

})(variables, pageResponse);

